column8:
・優しい効きめ「ベープマット」<br>
　　使い始めの効果が高く、使用開始から短時間で<br>
　　効き目のピークに達して蚊を駆除し、後は<br>
　　緩やかなカーブで蒸散量が減ります。<br>
　　寝室や余分な薬剤の蒸散が気になる子供部屋<br>
　　などで最適です。<br><br>
・安全設計なので安心してお使いただけます。<br>
　　一定温度で加熱するサーミスタと、過電流を<br>
　　防ぐヒューズを採用した安心設計です。<br>
　　パイロットランプ付きなので、暗いところ<br>
　　でも居場所がわかります。<br>
　　また、プラグを抜かずにスイッチでオン・<br>
　　オフもできます。<br>
　　煙がでません。有効成分以外の灯油・油・<br>
　　水のような成分を蒸散させません。<br><br>
・消費電力も少ないので、お得です。<br>
　　マット1枚あたりの消費電力は、一晩<br>
　　（約12時間）使用しても、約1～2円。<br>
　　4.5畳～8畳のお部屋で使えます。<br>

